import { StyleSheet, Text, TouchableOpacity, View } from "react-native";
import React from "react";
import { useNavigation } from "@react-navigation/native";
import { Image } from "react-native";

const Menu = () => {
  const navigation = useNavigation(); // useNavigation is hook
  return (
    <View style={styles.mainContainer} >
      <TouchableOpacity
        style={styles.BtnStyles} // navigate is method
         onPress={()=>navigation.navigate('course')}  // navigation.navigate() this is navigation, just screen name in the navigate('course'), remember pass those name whose create on own in stack.Screen name='[component name]'
      >
        <Image style={styles.iconStyle} source={{uri:'https://img.icons8.com/?size=1x&id=113845&format=png '}} />
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.BtnStyles} // navigate is method
     onPress={()=>navigation.navigate('about')} // navigation.navigate() this is navigation, just screen name in the navigate('course'), remember pass those name whose create on own in stack.Screen name='[component name]'
      >
        <Image  style={styles.iconStyle} source={{uri:' https://img.icons8.com/?size=1x&id=113861&format=png'}}  />
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.BtnStyles} // navigate is method
       onPress={()=>navigation.navigate('contact')}  // navigation.navigate() this is navigation, just screen name in the navigate('course'), remember pass those name whose create on own in stack.Screen name='[component name]'
      >
      <Image  style={styles.iconStyle} source={{uri:'https://img.icons8.com/?size=1x&id=91298&format=png'}}  />
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.BtnStyles} // navigate is method
        onPress={()=>navigation.navigate('student')}  // navigation.navigate() this is navigation, just screen name in the navigate('course'), remember pass those name whose create on own in stack.Screen name='[component name]'
      >
        <Image  style={styles.iconStyle} source={{uri:' '}}  />
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  mainContainer:{
    flexDirection:'row',
    display:'flex',
    alignItems:'center',
    justifyContent:'center',
    justifyContent:'space-evenly',
    // backgroundColor:'#DF3079',
    // borderWidth:2,
    width:'100%'
  },
  BtnStyles: {
  
  },
  iconStyle:{
    width:'100%',
    height:50,
    aspectRatio:1,
    borderRadius:12
  }
});
export default Menu;
